import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


import Title from "./components/Title";

class App extends Component {
  render() {
    return (
      <section>
        <div>
          <div>
            <Title></Title>
            <button>Crear cuenta</button>
            <image src={process.env.PUBLIC_URL + './images/bg-gep-png'}/>
            <div>
              <ul>
                <li>
                  <h3>Califica con emociones</h3>
                  <p>Califica con experiencias no con numeros</p>
                </li>
                <li>
                  <h3>¿Sin internet?, ¡No hay problema!</h3>
                  <p>Places funciona sin internet o en cconexiones lentas</p>
                </li>
                <li>
                  <h3>Lugares favoritos </h3>
                  <p>Define tus lugares preferidos</p>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default App;
